import React, { Component } from 'react'
import TransitMode from "./TransitMode";

const GET_MODES = gql`
    query {
        modes {
            name
            counter
        }
    }
`

class TransitModeList extends Component {

  render() {
    return (
      <div>
        {this.modes.map(mode => <TransitMode key={mode.name} mode={mode} />)}
      </div>
    )
  }
}

export default TransitModeList
